package com.example.food.controller;

import com.example.food.entity.Product;

import javax.servlet.ServletException;
import javax.servlet.http.HttpServlet;
import javax.servlet.http.HttpServletRequest;
import javax.servlet.http.HttpServletResponse;
import java.io.IOException;
import java.util.ArrayList;
import java.util.List;

public class ListProductServlet extends HttpServlet {

    public static ArrayList<Product> list = new ArrayList<>();

    {
        list.add(new Product(1, "chowmein", "chowmein",  "data:image/jpeg;base64,", 2000, 1));
        list.add(new Product(2, "general tso chicken", "general tso chicken", "data:image/jpeg;base64,", 1500, 1));
        list.add(new Product(3, "mongolian beef", "mongolian beef", "https://res.cloudinary.com/musicbox888/image/upload/v1630832242/wutnyjmmxugszdiwuigw.webp", 1300, 1));
        list.add(new Product(4, "chiken nuggies", "chicken nuggies", "http://res.cloudinary.com/musicbox888/image/upload/v1630977100/m3umdlujz4xzod40xx8l.jpg", 1200, 1));
    }

    @Override
    protected void doGet(HttpServletRequest req, HttpServletResponse resp) throws ServletException, IOException {
        req.setAttribute("list", list);
        req.getRequestDispatcher("/admin/product/list.jsp").forward(req, resp);
    }
}
